def generate_world_user(matrix):
    try:
        if type(matrix[0]) == list:
            wereld = bvp_practicum2.creeer_wereld(len(matrix), len(matrix[0]))
        else:
            wereld = bvp_practicum2.creeer_wereld(matrix[0][0], matrix[0][1])
    except Exception as e:
        print(f"Je programma gooide de volgende error bij de functie 'creeer_wereld': {e}")
        exit()

    size = sys.getsizeof(wereld)
    if size > 200:
        print("Je functie 'creeer_wereld' maakte een wereld aan die te veel plaats in het geheugen inneemt. Probeer"
              " de matrix op een meer spaarse manier op te slaan")
    else:
        print("De functie 'creeer_wereld' maakte de wereld goed aan.")


    if type(matrix[0]) == list:
        for i, row in enumerate(matrix):
            for j, element in enumerate(row):
                for _ in range(element):
                    try:
                        bvp_practicum2.voeg_overval_toe(wereld, i, j)
                    except Exception as e:
                        print(f"Je programma gooide de volgende error bij de functie 'voeg_overval_toe': {e}")
                        exit()

    else:
        for element in matrix[1:]:
            for _ in range(element[2]):
                try:
                    bvp_practicum2.voeg_overval_toe(wereld, element[0], element[1])
                except Exception as e:
                    print(f"Je programma gooide de volgende error bij de functie 'voeg_overval_toe': {e}")
                    exit()

    return wereld


def test_functie(functie, verwachte_output, *args):
    function_name = str(functie).split(" ")[1]
    try:
        output_user = functie(*args)
    except Exception as e:
        print(f"Je programma gooide de volgende error bij de functie '{function_name}': {e}. "
              f"De output van het programma moest {verwachte_output} zijn.")
        return

    if output_user != verwachte_output:
        print(f"De output van de functie '{function_name}' is fout. Ze gaf {output_user}, maar het moest"
              f" {verwachte_output} zijn.")
    else:
        print(f"De functie '{function_name}' slaagde voor deze test case.")



def test_case(matrix, aantal_overvallen, gevaarlijkste_regio, test_aantal_overvallen_op_pos, test_overval_op_pos):
    """
    :param matrix: de hele matrix met alle nullen etc.
    :param aantal_overvallen: totaal aantal overvallen
    :param gevaarlijkste_regio: aantal overvallen in gevaarlijkste regio
    :param test_aantal_overvallen_op_pos: test gevallen voor functie 'geef_aantal_overvallen_op_positie'. Elk element
                                          vd vorm [x, y, aantal_overvallen]
    :param test_overval_op_pos: test gevallen voor functie 'er_is_een_overval_gebeurd_op_positie'. Elk element
                                vd vorm [x, y, True/False]
    """

    wereld = generate_world_user(matrix)

    test_functie(bvp_practicum2.geef_aantal_overvallen, aantal_overvallen, wereld)

    test_functie(bvp_practicum2.meeste_overvallen_in_regio, gevaarlijkste_regio, wereld)

    for pos in test_aantal_overvallen_op_pos:
        test_functie(bvp_practicum2.geef_aantal_overvallen_op_positie, pos[2], wereld, pos[0], pos[1])

    for pos in test_overval_op_pos:
        test_functie(bvp_practicum2.er_is_een_overval_gebeurd_op_positie, pos[2], wereld, pos[0], pos[1])


def test_voeg_overval_toe(hoogte, breedte, echte_overvallen, fake_overvallen):
    try:
        wereld = bvp_practicum2.creeer_wereld(hoogte, breedte)
    except Exception as e:
        print(f"Je programma gooide de volgende error bij de functie 'creeer_wereld': {e}")
        raise Exception

    size = sys.getsizeof(wereld)
    if size > 200:
        print("Je functie 'creeer_wereld' maakte een wereld aan die te veel plaats in het geheugen inneemt. Probeer"
              " de matrix op een meer spaarse manier op te slaan")
    else:
        print("De functie 'creeer_wereld' maakte de wereld goed aan.")

    for overval in echte_overvallen:
        test_functie(bvp_practicum2.voeg_overval_toe, True, wereld, overval[0], overval[1])

    for overval in fake_overvallen:
        test_functie(bvp_practicum2.voeg_overval_toe, False, wereld, overval[0], overval[1])


